import Heading from "../../../UI/Heading/Heading";
import TextBody from "../../../UI/TextBody/TextBody";
import Button from "../../../UI/Button/Button";
import emptyIllustration from "../../../../assets/suggestions/desktop";
const NoSuggestions = () => {
  return (
    <article>
      <img />
      <Heading type="h3">There is no feedback yet</Heading>
      <TextBody>
        Got a suggestions? Found a bug that needs to be squashed? We love
        hearing about new ideas to improve our app.
      </TextBody>

      <Button type="violet">+ Add Feedback</Button>
    </article>
  );
};

export default NoSuggestions;
